import React from 'react';
import './App.css';
import Header from './Header';
import Home from './Home'
import { BrowserRouter as Router, Routes, Route}
from "react-router-dom";

function App() {
  return (
    <Router>
      <div clasName="app">

        <Route path="/">
          <Header />
          <Home />
        </Route>
        <Route path="/checkout">
          <Header />
          <h1>hoi</h1>
        </Route>

      </div>
    </Router>
  );
}

export default App;
